import React, { Component } from 'react';

class Rodape extends Component{
    render(){
        return(
            <div className="rodape">
                <span class="primeira-lista">
                    <ul>
                        <li><a href="#">Link 1</a></li>
                        <li><a href="#">Link 2</a></li>
                        <li><a href="#">Link 3</a></li>
                        <li><a href="#">Link 4</a></li>
                        <li><a href="#">Link 5</a></li>
                    </ul>
                </span>
                <span className="texto">
                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Praesent fringilla gravida tincidunt. Mauris iaculis finibus urna, vitae venenatis lacus sollicitudin non. Phasellus pulvinar fermentum volutpat. Pellentesque vitae leo quis purus aliquet faucibus et aliquam ante. Sed sed eros eu lectus pharetra dictum sit amet ac quam.</p>
                </span>
            </div>
        )
    }
}
export default Rodape;
